import React from 'react';
// Header 컴포넌트 정의
function Header() {
  const headerStyle = {
    backgroundColor: '#D4D2E3',
    color: '#5D5A88',
    padding: '20px',
    position: 'relative',
    display: 'flex',
    justifyContent: 'left',
    alignItems: 'center',
    gridArea: 'header',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  };
  return (
    <header>
      <div>
        <a style={headerStyle}>BALANCETALK</a>
      </div>
    </header>
  );
}

export default Header;
